import React, {useEffect, useState} from "react";
import "./AddPlace.css";
import Axios from "axios";

const AddPlace = () => {

    const [ place, setPlace] = useState()

useEffect(() => {
    Axios.get('http://localhost:5000/api/exploit')
    .then(res => res.data)
    .then(data => setPlace(data))
}, [])

    return(<div className="AddPlace_container">
        Je suis le composant AddPlace !
    </div>
    )
}

export default AddPlace;
